#some magic to clean up the data (separate packets and get rid of MISO values which are all (0x00)
def cleanUpRaw(rawData):
    delimiter = ']'
    cleaned = [entry + delimiter for entry in rawData.split(']') if len(entry+delimiter) == 162]
    return cleaned

def getPacketAsList(packet):
    #packets should look like this:
    # '[0xA0(0x00)0x00(0x00)0x7E(0x00)0xFA(0x00)0xC0(0x00)0x40(0x00)0x00(0x00)0x07(0x00)0xA8(0x00)0x40(0x00)0x07(0x00)0xA9(0x00)0x40(0x00)0x00(0x00)0x00(0x00)0x00(0x00)]'
    return [entry for entry in packet.strip('[]').split('(0x00)') if entry != '']

def listNonRepeating(cleanedRaw):
    nonRepList = []
    last = []
    for i in cleanedRaw:
        testPacket = getPacketAsList(i)
        if testPacket != last:
            last = testPacket
            nonRepList.append(last)
    return nonRepList

